class Solution {
public:
    int numRescueBoats(vector<int>& people, int limit) {

        sort(people.begin(), people.end(), greater<int>());

        vector<pair<int, int>> boats {};
        int counter = 0;

        for(int w : people) {

            //cout << "people " << w <<endl;
            
            bool insered = false;
            for(auto itr = boats.begin(); itr != boats.end();) {
                
                //cout << "boat " << itr -> first;

                if(itr -> first + w <= limit){
                    itr -> first += w;
                    itr -> second ++;
                    insered = true;
                    //cout << " here";
                }

                if(itr -> first == limit || itr -> second == 2 ) {
                    itr = boats.erase(itr);
                    counter++;
                    //cout << " full" << endl;
                }
                else {
                    itr++;
                    //cout << endl;
                }

                if(insered)
                    break;

            }

            if(!insered)
                boats.push_back({w, 1});

        }

        return counter + boats.size();
    }
};

